import React from "react";

const City = (props) => {
  return (
    <div className="container">
      <div className="row">
        {props.map((city) => {
          return (
            <div className="col-12 col-lg-4">
              <img src={city.image} width="100%" alt={city.name} />
              <div>
                <Title>{city.name}</Title>
                <Text>{city.subText}</Text>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default City;
